import './Post.css'

function Post(content) {
    const deletePost = () => {}

    return (
        <li className="post">
            <span>User id: {content.id}</span>
            <h2>{content.title}</h2>
            <p>{content.body}</p>
            <span>Post id: {content.userId}</span>
            <button className="post-button-delete" onClick={deletePost}>
                Delete this is post
            </button>
        </li>
    )
}

export default Post
